 Here is a simple JavaScript code snippet that will output the values of a dictionary (or object) sorted by key alphabetically:

```javascript
const myObj = {
  apple: "red",
  banana: "yellow",
  grape: "purple",
  orange: "orange",
};

// Convert the object to an array of key-value pairs.
const sortedKeys = Object.entries(myObj).sort((a, b) => {
  const [keyA] = a;
  const [keyB] = b;

  return keyA.localeCompare(keyB);
});

// Extract the values from the sorted array.
const sortedValues = sortedKeys.map(([, value]) => value);

console.log(sortedValues); // Output: ["red", "yellow", "orange", "purple"]
```
